  return (
    <Routes>
      <Route path="/" element={<Overview />} />
      <Route path="/transactions" element={<Transactions />} />

      {/* ВСЕ НЕСУЩЕСТВУЮЩИЕ ПУТИ */}
      <Route path="*" element={<NotFoundPage />} />
    </Routes>
  );
}

export default App;
